const findLowest = (arrayOfObjects, prop) => {
  const lowestVal = arrayOfObjects.reduce((prevVal, currVal) =>
    prevVal[prop] > currVal[prop] ? currVal[prop] : prevVal[prop]
  );
  const object = arrayOfObjects.find( el => el[prop] === lowestVal)

  console.log(object + " " + lowestVal)
  return object
};

export default findLowest
